script: |
  super -f text -I q71.spq | sort > q71.out

inputs:
  - name: q71.spq
    data: |
      SELECT DISTINCT + cor1.col0 * + 68 AS col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q71.out
    data: |
      204
      4352
      5440
